export const options = {
	method: 'GET',
	headers: {
		'x-rapidapi-key': process.env.RAPID_API_KEY,
		'x-rapidapi-host': ''
	}
};

export async function fetchData(url, options){
    const response = await fetch(url, options);
    const data = await response.json();

    return data;
}
